import React from 'react'

class ZoneComp extends React.Component {
	state= {
		id: "",
		name: ""
	}

	componentDidUpdate(prevProps) {
    if(this.props.data !== prevProps.data) {
      let keys = Object.keys(this.props.data[0])
			this.setState({ id: keys[0]})
			this.setState({ name: keys[1]})
    }

	}

	renderData = (data, id, name) => {
		return data.map((data) => {
			return (
				<li key={data[id]}>{data[id]} : {data[name]} 
					<button onClick={() => { 
            this.props.setID(data[id]) 
            }}>Go
          </button>
				</li>
			)	
		})	
	}

	render() {
		return (
			<div>Zones:
        {this.state.name && this.renderData(this.props.data, this.state.id, this.state.name)}
      </div>

		)
	}
}

export default ZoneComp
